import React from 'react';
import './ClassicalCheckboxesStyles.scss';

import { connect } from 'react-redux';
import { c_checkboxes_changed } from '../../redux/ccheckboxes-action';


const mapDispatchToProps = dispatch => {
	return {
		c_checkboxes_changed: (status) => dispatch(c_checkboxes_changed(status))
	}
}


const ClassicalCkeckBoxes = () => {
	return(
		<div className="classical_checkbox_container">
		  <input id="composer_checkbox" ref="composer_check" type="checkbox" className='classical_checkboxes' />
		  <label htmlFor="composer_checkbox">This Composer</label>

		  <input id="worktype_checkbox" ref="worktype_check" type="checkbox" className='classical_checkboxes' />
		  <label htmlFor="worktype_checkbox">Work Type</label>

		  <input id="c_genre_checkbox" ref="c_genre_check" type="checkbox" className='classical_checkboxes' />
		  <label htmlFor="c_genre_checkbox">Genre</label>
		</div>
	);
}

export default ClassicalCkeckBoxes;
